import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  font-family: Arial, sans-serif;
  font-size: 14px;

  margin-top: 10px;

  ul {
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    div {
      background: red;
    }

    li {
      display: flex;
      align-items: center;
      padding: 10px 10px;
      color: #fff;

      &:hover {
        background-color: #434c5b;
      }

      a {
        padding-left: 10px;
        text-decoration: none;
        color: #eee;
      }
    }
  }
`;
